import React, {Suspense} from 'react'
import {useImage} from 'react-image'
 
function Image() {
  const {src} = useImage({
    srcList: 'https://post.medicalnewstoday.com/wp-content/uploads/2020/02/man-exercising-plank-push-up-1200x628-facebook.jpg',
  })
 
  return <img src={src} />
}
 
export default function MyComponent() {
  return (
    <Suspense>
      <MyImageComponent />
    </Suspense>
  )
}
